import React, { Component } from "react";
import VenuesCard from "../Venues/VenuesCard";
import GigsManager from "../../modules/GigsManager";

export default class VenuesList2 extends Component {
  state = { venues: [] };

  loggedInUser = parseInt(sessionStorage.getItem("credentials"));
  componentDidMount() {
    GigsManager.getAll(this.loggedInUser).then(gigs => this.setState({ gigs: gigs }))

  }

  render() {
    return (
      <React.Fragment>
        <section className="section-content">
          <button
            type="button"
            className="btn"
            onClick={() => {
              this.props.history.push("/gigs/new");
            }}
          >
            Add Venue
          </button>
        </section>

        {this.state.gigs.map(gig => (

          <GigsCard id={gig.id} gig={gig} name={gig.name} resource="venues" />
        ))}
      </React.Fragment>
    );
  }
}
